column8:
ラチェット式なので、握力の弱い女性や高齢者の方にも楽に剪定ができます。4段式特殊 ギアの補助で太い枝でも4回にわけて切ることができます。持ち手は人間工学に基づき設計された左右対称タイプで右利きでも左利きでも握りやすくなっていま す。刃先は鋼鉄製でフッ素樹脂加工されているので錆びにくく、樹液がついても拭き取るだけでOKです。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ラチェット式なので、握力の弱い女性や高齢者の方にも楽に剪定ができます。4段式特殊ギアの補助で太い枝でも4回にわけて切ることができます。持ち手は人間工学に基づき設計された左右対称タイプで右利きでも左利きでも握りやすくなっています。刃先は鋼鉄製でフッ素樹脂加工されているので錆びにくく、樹液がついても拭き取るだけでOKです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">全長20.6×刃渡り6cm</font><br><font color="#333333" size="-1">個装サイズ：10.5×1.5×27cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約230g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">刃:鋼<br>ハンドル:アルミニウム</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">ラチェット式(4段階ギアシステム)<br>切断可能枝直径:2.5cm</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">台湾</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
